INSERT INTO `movies` (`MovieId`, `MovieName`, `Genre`, `Sutradara`, `Company`, `Category`, `Rating`, `DateStart`, `DateEnd`, `Duration`, `Synopsis`, `Image`, `Note`) VALUES
('1b176663-46f3-11e3-b1d3-c80aa9a0db', 'Iron Man 3', 'Action,Adventure,Fantasy', 'Shane Black', 'Marvel Studios', 'PG', 5, '2013-11-07', '2013-11-24', 130, 'When Tony Stark world is torn apart by a formidable terrorist called the Mandarin, he starts an odyssey of rebuilding and retribution.', '1.jpg', 'Ke1Y3P9D0Bc'),
('1c176663-46f3-11e3-b1d3-c80aa9a0db', 'Despicable Me 2', 'Animation,Adventure,Comedy', 'Pierre Coffin and Chris Renaud', 'Universal Pictures / Illumination Entertainment', 'PG13', 5, '2013-11-05', '2013-11-23', 98, 'Gru is recruited by the Anti-Villain League to help deal with a powerful new super criminal.', '2.jpg', 'HwXbtZXjbVE'),
('1c1767c6-46f3-11e3-b1d3-c80aa9a0db', 'Fast & Furious 6', 'Action,Crime,Thriller', 'Justin Lin', 'Universal Pictures', 'PG13', 5, '2013-11-05', '2013-11-25', 130, 'Hobbs has Dom and Brian reassemble their crew in order to take down a mastermind who commands an organization of mercenary drivers across 12 countries. Payment? Full pardons for them all.', '3.jpg', 'dKi5XoeTN0k'),
('1c176914-46f3-11e3-b1d3-c80aa9a0db', 'Monsters University', 'Animation,Adventure,Comedy', 'Dan Scanlon', 'Walt Disney Pictures/ Pixar', 'PG13', 4, '2013-11-10', '2013-11-26', 104, 'A look at the relationship between Mike and Sulley during their days at Monsters University -- when they werenot necessarily the best of friends.', '4.jpg', 'xBzPioph8CI'),
('1c176a66-46f3-11e3-b1d3-c80aa9a0db', 'Man of Steel', 'Action,Adventure,Fantasy', 'Zack Snyder', 'Warner Bros./Legendary Pictures', 'PG', 3, '2013-11-09', '2013-11-27', 143, 'A young itinerant worker is forced to confront his secret extraterrestrial heritage when Earth is invaded by members of his race.', '5.jpg', 'T6DJcgm3wNY'),
('1c176b9a-46f3-11e3-b1d3-c80aa9a0db', 'The Croods', 'Animation,Adventure,Comedy', 'Kirk DeMicco and Chris Sanders', '20th Century Fox/DreamWorks Animation', 'PG', 3, '2013-11-14', '2013-12-05', 98, 'After their cave is destroyed, a caveman family must trek through an unfamiliar fantastical world with the help of an inventive boy.', '6.jpg', 'VeG3Zmk08UU'),
('1c176cd2-46f3-11e3-b1d3-c80aa9a0db', 'World War Z', 'Action,Adventure,Horror', 'Marc Forster', 'Paramount Pictures', 'G', 4, '2013-11-13', '2013-11-30', 116, 'United Nations employee Gerry Lane traverses the world in a race against time to stop the Zombie pandemic that is toppling armies and governments, and threatening to destroy humanity itself.', '7.jpg', 'HcwTxRuq-uk'),
('1c176e1b-46f3-11e3-b1d3-c80aa9a0db', 'Oz the Great and Powerful', 'Adventure,Family,Fantasy', 'Sam Raimi', 'Walt Disney Pictures', 'PG', 4, '2013-11-11', '2013-11-26', 130, 'A small-time magician is swept away to an enchanted land and is forced into a power struggle between three witches.', '8.jpg', 'DylgNj4YQVc'),
('1c176f58-46f3-11e3-b1d3-c80aa9a0db', 'Star Trek Into Darkness', 'Action,Adventure,Sci-Fi', 'J. J. Abrams', 'Paramount Pictures/Bad Robot Productions', 'PG13', 4, '2013-11-14', '2013-12-02', 132, 'After the crew of the Enterprise find an unstoppable force of terror from within their own organization, Captain Kirk leads a manhunt to a war-zone world to capture a one man weapon of mass destruction.', '9.jpg', 'QAEkuVgt6Aw'),
('1c177098-46f3-11e3-b1d3-c80aa9a0db', 'Gravity', 'Drama,Sci-Fi,Thriller', 'Alfonso Cuarn', 'Warner Bros.', 'NC21', 4, '2013-11-07', '2013-11-28', 91, 'A medical engineer and an astronaut work together to survive after an accident leaves them adrift in space.', '10.jpg', 'OiTiKOy59o4'),
('1c1771aa-46f3-11e3-b1d3-c80aa9a0db', 'The Wolverine', 'Action,Adventure,Fantasy', 'James Mangold', '20th Century Fox/Marvel Studios', 'PG13', 5, '2013-11-12', '2013-12-03', 126, 'When Wolverine is summoned to Japan by an old acquaintance, he is embroiled in a conflict that forces him to confront his own demons.', '11.jpg', 'g7kdUy5_WlI'),
('1c1772e2-46f3-11e3-b1d3-c80aa9a0db', 'Pacific Rim', 'Action,Adventure,Sci-Fi', 'Guillermo del Toro', 'Warner Bros./Legendary Pictures', 'PG', 5, '2013-11-10', '2013-11-27', 131, 'As a war between humankind and monstrous sea creatures wages on, a former pilot and a trainee are paired up to drive a seemingly obsolete special weapon in a desperate effort to save the world from the apocalypse.', '12.jpg', '5guMumPFBag'),
('1c177434-46f3-11e3-b1d3-c80aa9a0db', 'G.I. Joe: Retaliation', 'Action,Adventure,Sci-Fi', 'Jon Chu', 'Paramount Pictures/MGM', 'PG13', 5, '2013-11-04', '2013-11-25', 110, 'The G.I. Joes are not only fighting their mortal enemy Cobra; they are forced to contend with threats from within the government that jeopardize their very existence.', '13.jpg', 'jqW6ynaPXHU'),
('1c177575-46f3-11e3-b1d3-c80aa9a0db', 'Now You See Me', 'Crime,Mystery,Thriller', 'Louis Leterrier', 'Summit Entertainment', 'R', 3, '2013-11-10', '2013-11-29', 115, 'An FBI agent and an Interpol detective track a team of illusionists who pull off bank heists during their performances and reward their audiences with the money.', '14.jpg', 'KzJNYYkkhzc'),
('42f45453-5c32-49a2-bd4d-03da0f4f38b2', 'Super ', 'Action', 'Super ', 'Super ', 'G', 1, '2013-11-11', '2013-11-20', 213, 'Super ', '14.jpg', 'KzJNYYkkhzc');
